import React, { Component } from 'react';
import {connect} from 'react-redux';
import KhuNha from './khuNha';
import {hienThiCacKhuNha as hienThiCacKhuNha} from '../../../actions/khuNhaActions';

class DanhSachKhuNha extends Component {

    khuNhas = this.props.action.payload;

    render() {
        return (
            <div>
                {khuNhas.map(khuNha => {
                    <KhuNha tenKhuNha={khuNha.tenKhuNha} />
                })}
            </div>
        );
    }
}

const mapStatetoProps = state => ({
    // account: state.account
})
export default connect(mapStatetoProps, {hienThiCacKhuNha} )(Information)
